import {
  Button,
  ButtonPropsSizeOverrides,
  ButtonPropsVariantOverrides
} from '@mui/material';
import { OverridableStringUnion } from '@mui/types';

type ButtonClickProps = {
  children: string;
  type?: 'button' | 'reset' | 'submit';
  variant?: OverridableStringUnion<
    'text' | 'contained' | 'outlined',
    ButtonPropsVariantOverrides
  >;
  backgroundColor?: string;
  color?: string;
  size?: OverridableStringUnion<
    'small' | 'medium' | 'large',
    ButtonPropsSizeOverrides
  >;
  onClick?: (event) => void;
  disabled?: boolean;
  borderRadius?: number;
  boxShadow?: boolean;
};

export const ButtonClick = ({
  children,
  type,
  variant,
  backgroundColor,
  color,
  size,
  onClick,
  disabled,
  borderRadius,
  boxShadow
}: ButtonClickProps) => {
  return (
    <Button
      type={type}
      variant={variant}
      style={{
        backgroundColor: backgroundColor,
        color: color,
        borderRadius: borderRadius + 'px',
        boxShadow: boxShadow && '0px 15px 20px rgba(46, 229, 157, 0.4)'
      }}
      size={size}
      onClick={onClick}
      disabled={disabled}
    >
      {children}
    </Button>
  );
};
